Now you can import sample data and make your website just like the demo website in 1 click. All you have to do is install our theme first and then install all the recommended plugins. After that, you have to go to Import Demo Data under Appearance Menu. Click on Import Demo Data button. That's it.

&nbsp;

&nbsp;

<img class="alignnone size-full wp-image-160 img-responsive" src="https://www.spiraclethemes.com/wordpress-themes/prasoon/wp-content/uploads/2017/07/1-click-demo-import.png" alt="" width="1183" height="623" />

Add amazing parallax effect to your website with ease. Prasoon theme has an option to add parallax effect within widgets. All you have to do is to click the option and save.

&nbsp;

&nbsp;

<img class="alignnone size-full wp-image-165 img-responsive" src="https://www.spiraclethemes.com/wordpress-themes/prasoon/wp-content/uploads/2017/07/parallax-effect.png" alt="" width="1343" height="665" />

&nbsp;

&nbsp;

Prasoon has separate color settings for each section. Every single bit of section colors can be customized. You can change Heading, Subheading, Background, Icons, and content colors through Color Settings. Make your website as colorful you want.

&nbsp;

&nbsp;

&nbsp;

<img class="alignnone size-full wp-image-171 img-responsive" src="https://www.spiraclethemes.com/wordpress-themes/prasoon/wp-content/uploads/2017/07/section-colors.png" alt="" width="1355" height="645" />

&nbsp;

&nbsp;

You can easily rearrange your sections by the order you want. There is no restriction like other themes. Reordering your section is super easy. Just drag and drop.and save it.

&nbsp;

